Join us in our continued study through the seven churches. Read about the church of the Laodiceans and Jesus' reaction to the church being lukewarm. The same lukewarmness happens today as present culture moves to esteem relativism in place of the Word of God, Jesus. Consider the different applications of this Scripture, choosing a heart of repentance. May we be those who hear Jesus' voice and steadfastly receive Him.
